import React from 'react'
import "./Portfolio.css"
import {Swiper, SwiperSlide} from "swiper/react"

const Portfolio = () => {
  return (
    <div className='portfolio'>
        {/* heading */}
        <span>Recent Projects</span>
        <span>portfolio</span>
        {/* Slider */}
        <Swiper>
            <SwiperSlide></SwiperSlide>
        </Swiper>
    </div>
  )
}

export default Portfolio
